111711,1201117,1202,'1990.10.18','2016-10-18 20:33:54'),(120111712,1201117,1200,'珠海','2016-10-18 20:33:54'),(120111713,1201117,1206,'166','2016-10-18 20:33:54'),(120111714,1201117,1006,'1','2016-10-18 20:33:54'),(120115101,1201151,1201,'1994.05.08','2016-10-18 20:34:01'),(120115102,1201151,1203,'江南造船厂','2016-10-18 20:34:01'),(120115103,1201151,1208,'驱逐舰052型','2016-10-18 20:34:01'),(120115104,1201151,1204,'驱1支队','2016-10-18 20:34:01'),(120115105,1201151,1205,'北海舰队','2016-10-18 20:34:01'),(120115106,1201151,2000,'112哈尔滨','2016-10-18 20:34:01'),(120115107,1201151,2000,'首舰::052型驱逐舰','2016-10-18 20:34:01'),(120115108,1201151,2000,'海军机动六号军事演习','2016-10-18 20:34:01'),(120115109,1201151,2000,'环日航行','2016-10-18 20:34:01'),(120115110,1201151,2000,'中俄海上联合军事演习','2016-10-18 20:34:01'),(120115111,1201151,2000,'索马里护航','2016-10-18 20:34:01'),(120115112,1201151,2001,'2012.04.22-27日，中俄“海上联合-2012”军事演习在青岛附近黄海海域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军少将担任。中方参演兵力分别来自北海舰队、东海舰队和南海舰队，包括112哈尔滨、115沈阳、137福州、138泰州、139宁波、529舟山、530徐州、548益阳、527洛阳、528绵阳、881洪泽湖、和平方舟号医院船、2艘新型常规潜艇、4艘新一代导弹快艇等18艘舰艇。中国海军航空兵派出13架新型飞机和5架舰载直升机参演。俄方派出7艘舰艇参演。俄罗斯海军太平洋舰队将派出旗舰011瓦良格号巡洋舰，572维诺格拉多夫海军上将号、564特里布茨海军上将号和543沙波什尼科夫元帅号3艘无畏级反潜驱逐舰，佩琴加号中型海上油轮，以及2艘救援拖船参演。','2016-10-18 20:34:01'),(120115113,1201151,2001,'2014.05.20-26日，中俄“海上联合-2014”军事演习在中国长江口以东的东海北部海空域举行。演习总导演分别由中国海军副司令员田中海军中将和俄海军副司令费多坚科夫海军中将担任，26日他们在设于上海某军港码头的联合导演部共同宣布：中俄“海上联合-2014”军事演习圆满结束。中方参演兵力以东海舰队为主，包括151郑州、112哈尔滨、139宁波、538烟台、573柳州、886千岛湖、某新型导弹快艇等水面舰艇8艘、潜艇2艘、固定翼飞机9架。俄方派出6艘舰艇参演。俄罗斯太平洋舰队旗舰011瓦良格号导弹巡洋舰、715快速号驱逐舰、548潘捷列耶夫海军上将号大型反潜舰、涅维尔斯科伊海军上将号大型登陆舰、伊利姆号中型海洋油船，卡拉尔号海洋拖船陆续驶入港口。','2016-10-18 20:34:01'),(120115114,1201151,2001,'2014.12.04，5艘中国舰艇通过大隅海峡向东航行，随后在西太平洋参加机动六号军事演习：北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖。其中116石家庄于2014.12.15穿过宫古海峡进入东海。2014.12.25，4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，这支舰队接下来很可能穿过日本海，经朝鲜海峡返回位于山东的北海舰队基地，其航迹绕将日本一圈：112哈尔滨、538烟台、546盐城、889太湖。2014.12.28，对于正在绕行日本返回中国本土的中国海军舰艇编队，日本称已经表现出了高度的警戒。周六下午2点30分左右，日本海上自卫队第4护卫队群“凉月”号驱逐舰和第4航空群所属P-3C反潜机，在对马海峡东北约300公里的海域对中国海军舰艇编队进行了持续跟踪拍摄。','2016-10-18 20:34:01'),(120115115,1201151,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:34:01'),(120115116,1201151,2001,'2016.01.26，4艘中国舰艇穿越对马海峡向东进入日本海：112哈尔滨、538烟台、881洪泽湖、854天狼星。2016.02.02，4艘中国舰艇通过津轻海峡横穿日本列岛。2016.02.16，日本自卫队发现中国海军编队穿越大隅海峡向西航行，绕日本近一周后返回东海。','2016-10-18 20:34:01'),(120115117,1201151,2001,'护航编队#14，2013.02.16，中国海军第14批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2013.03.13护航开始，08.26护航结束，09.28归港。护航编队由112哈尔滨(1994.05.08)、528绵阳(2005.04)、887微山湖(2004.04.18)组成。编队指挥员北海舰队参谋长袁誉柏少将，编队政委北海舰队政治部副主任吴海华大校；730余人；航行天数225天，护卫63批，181艘船舶，参加“和平-13”多国海军联合演习；新加坡、泰国','2016-10-18 20:34:01'),(120115118,1201151,2001,'护航编队#24，2016.08.10，中国海军第24批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2016.09.02护航开始，护航结束，归港。护航编队由112哈尔滨(1994.05.08)、579邯郸(2015.08.16)、960东平湖(2015.12.28)组成。','2016-10-18 20:34:01'),(120115119,1201151,2001,'首舰，052型驱逐舰112号“哈尔滨”舰，1994.05.08服役。','2016-10-18 20:34:01'),(120115120,1201151,1210,'142×15×5.1','2016-10-18 20:34:01'),(120115121,1201151,1211,'4800吨，标准4200吨','2016-10-18 20:34:01'),(120115122,1201151,1212,'32节','2016-10-18 20:34:01'),(120115123,1201151,1202,'1991.08.28','2016-10-18 20:34:01'),(120115124,1201151,1200,'哈尔滨','2016-10-18 20:34:01'),(120115125,1201151,1206,'112','2016-10-18 20:34:01'),(120115126,1201151,1006,'1','2016-10-18 20:34:01'),(120115201,1201152,1201,'1996.05.28','2016-10-18 20:34:05'),(120115202,1201152,1203,'江南造船厂','2016-10-18 20:34:05'),(120115203,1201152,1208,'驱逐舰052型','2016-10-18 20:34:05'),(120115204,1201152,1204,'驱1支队','2016-10-18 20:34:05'),(120115205,1201152,1205,'北海舰队','2016-10-18 20:34:05'),(120115206,1201152,2000,'尾舰::052型驱逐舰','2016-10-18 20:34:05'),(120115207,1201152,2000,'113青岛','2016-10-18 20:34:05'),(120115208,1201152,2000,'索马里护航','2016-10-18 20:34:05'),(120115209,1201152,2001,'护航编队#11，2012.02.27，中国海军第11批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2012.03.15护航开始，07.23护航结束，09.13