。9月初中俄联演结束后继续组织远海训练，5艘舰船在白令海航行并经塔纳加海峡进入西太平洋海域。于09.03到4日通过美国阿留申群岛间的国际海峡。这是中国人民解放军海军舰艇首次出现在该海域。','2016-10-18 20:34:22'),(120117313,1201173,1210,'156.4×17.2×7.8','2016-10-18 20:34:22'),(120117314,1201173,1211,'8480吨，标准6500吨','2016-10-18 20:34:22'),(120117315,1201173,1212,'32.7节','2016-10-18 20:34:22'),(120117316,1201173,1202,'2004.07.23','2016-10-18 20:34:22'),(120117317,1201173,1200,'泰州','2016-10-18 20:34:22'),(120117318,1201173,1206,'138','2016-10-18 20:34:22'),(120117319,1201173,1006,'1','2016-10-18 20:34:22'),(120117401,1201174,1201,'2006.11.18','2016-10-18 20:34:27'),(120117402,1201174,1203,'北方造船厂','2016-10-18 20:34:27'),(120117403,1201174,1208,'驱逐舰现代级956EM型','2016-10-18 20:34:27'),(120117404,1201174,1204,'驱3支队','2016-10-18 20:34:27'),(120117405,1201174,1205,'东海舰队','2016-10-18 20:34:27'),(120117406,1201174,2000,'尾舰::现代级驱逐舰','2016-10-18 20:34:27'),(120117407,1201174,2000,'139宁波','2016-10-18 20:34:27'),(120117408,1201174,2000,'中俄海上联合军事演习','2016-10-18 20:34:27'),(120117409,1201174,2001,'2006.09.28，中俄两国在圣彼得堡北方造船厂举行交舰仪式。','2016-10-18 20:34:27'),(120117410,1201174,2001,'2012.04.22-27日，中俄“海上联合-2012”军事演习在青岛附近黄海海域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军少将担任。中方参演兵力分别来自北海舰队、东海舰队和南海舰队，包括112哈尔滨、115沈阳、137福州、138泰州、139宁波、529舟山、530徐州、548益阳、527洛阳、528绵阳、881洪泽湖、和平方舟号医院船、2艘新型常规潜艇、4艘新一代导弹快艇等18艘舰艇。中国海军航空兵派出13架新型飞机和5架舰载直升机参演。俄方派出7艘舰艇参演。俄罗斯海军太平洋舰队将派出旗舰011瓦良格号巡洋舰，572维诺格拉多夫海军上将号、564特里布茨海军上将号和543沙波什尼科夫元帅号3艘无畏级反潜驱逐舰，佩琴加号中型海上油轮，以及2艘救援拖船参演。','2016-10-18 20:34:27'),(120117411,1201174,2001,'2014.05.20-26日，中俄“海上联合-2014”军事演习在中国长江口以东的东海北部海空域举行。演习总导演分别由中国海军副司令员田中海军中将和俄海军副司令费多坚科夫海军中将担任，26日他们在设于上海某军港码头的联合导演部共同宣布：中俄“海上联合-2014”军事演习圆满结束。中方参演兵力以东海舰队为主，包括151郑州、112哈尔滨、139宁波、538烟台、573柳州、886千岛湖、某新型导弹快艇等水面舰艇8艘、潜艇2艘、固定翼飞机9架。俄方派出6艘舰艇参演。俄罗斯太平洋舰队旗舰011瓦良格号导弹巡洋舰、715快速号驱逐舰、548潘捷列耶夫海军上将号大型反潜舰、涅维尔斯科伊海军上将号大型登陆舰、伊利姆号中型海洋油船，卡拉尔号海洋拖船陆续驶入港口。','2016-10-18 20:34:27'),(120117412,1201174,1210,'156.4×17.2×7.8','2016-10-18 20:34:27'),(120117413,1201174,1211,'8480吨，标准6500吨','2016-10-18 20:34:27'),(120117414,1201174,1212,'32.7节','20