16-10-18 20:34:34'),(120118116,1201181,2001,'护航编队#05，2010.03.04，中国海军第5批护航编队从南海舰队驻海南三亚某军港解缆起航，执行护航任务。2010.03.15护航开始，07.18护航结束，09.11归港。护航编队由168广州(2004.07.15)、568衡阳(2008.06.30)、887微山湖(2004.04.18)组成。编队指挥员南海舰队副参谋长张文旦少将，编队政委南海舰队政治部副主任陈俨少将；800余人；查证驱离可疑船只85批370艘次，为41批588艘商船实施了伴随护航；埃及、意大利、希腊、缅甸','2016-10-18 20:34:34'),(120118117,1201181,2001,'首舰，052B型驱逐舰168号“广州”舰，2004.07.15服役。','2016-10-18 20:34:34'),(120118118,1201181,1210,'154×16×6','2016-10-18 20:34:34'),(120118119,1201181,1211,'6200吨，标准5200吨','2016-10-18 20:34:34'),(120118120,1201181,1212,'30节','2016-10-18 20:34:34'),(120118121,1201181,1202,'2002.05.23','2016-10-18 20:34:34'),(120118122,1201181,1200,'广州','2016-10-18 20:34:34'),(120118123,1201181,1206,'168','2016-10-18 20:34:34'),(120118124,1201181,1006,'1','2016-10-18 20:34:34'),(120118201,1201182,1201,'2004.12','2016-10-18 20:34:40'),(120118202,1201182,1203,'江南造船厂','2016-10-18 20:34:40'),(120118203,1201182,1208,'驱逐舰052B型','2016-10-18 20:34:40'),(120118204,1201182,1204,'驱2支队','2016-10-18 20:34:40'),(120118205,1201182,1205,'南海舰队','2016-10-18 20:34:40'),(120118206,1201182,2000,'中俄海上联合军事演习','2016-10-18 20:34:40'),(120118207,1201182,2000,'169武汉','2016-10-18 20:34:40'),(120118208,1201182,2000,'尾舰::052B型驱逐舰','2016-10-18 20:34:40'),(120118209,1201182,2000,'索马里护航','2016-10-18 20:34:40'),(120118210,1201182,2001,'2013.07.05-12日，中俄“海上联合-2013”军事演习在俄罗斯符拉迪沃斯托克海空域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军中将担任。中方舰艇编队指挥员北海舰队副司令杨骏飞少将率领。中方参演兵力由海军北海舰队和南海舰队7艘主力作战舰艇组成，包括115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。3架新型舰载直升机和1个特战分队也随舰远赴俄罗斯参加这次演习。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。俄方派出12艘舰艇参演。俄罗斯太平洋舰队主力舰艇悉数出动，包括太平洋舰队旗舰011瓦良格号巡洋舰、572维诺格拉多夫海军上将号大型反潜舰、715快速号导弹驱逐舰、毒蜘蛛级导弹快艇2艘和基洛级常规潜艇等，共计12艘。','2016-10-18 20:34:40'),(120118211,1201182,2001,'护航编队#01，2008.12.26，中国海军第1批护航编队从南海舰队驻海南三亚某军港解缆起航，执行护航任务。2009.01.06护航开始，04.16护航结束，04.28归港。护航编队由169武汉(2004.12)、171海口(2005.12.26)、887微山湖(2004.04.18)组成。编队指挥员南海舰队参谋长杜景臣海军少将，编队副指挥员南海舰队政治部副主任殷敦平海军少将；800余人；为41批166艘船舶实施伴随护航，为46艘船舶实施区域护航，成功救援了3艘遇袭外国船只；','2016-10-18 20:34:40'),(120118212,1201182,2001,'护航编队#09，2011.07.02，中国海军第9批护航编队从南海舰队驻广东湛江某军港解缆起航，执行护航任务。2011.07.21护航开始，11.21护航结束，11.21归港。护航编队由169武汉(2004.12)、569玉林(2010.02.01)、885青海湖(1996.06)组成。编队指挥员南海舰队副参谋长管建国少将，编队政委海军某潜艇基地政委杜本印少将；800余人；安全护送中外船舶41批280艘，成功为世界粮食计划署“纳威尔3号”商船实施了护航，派医疗救护人员为5艘中外商船伤病船员实施了紧急救治；文莱、科威特、阿曼','2016-10-18 20:34:40'),(120118213,1201182,1210,'154×16×6','2016-10-18 20:34:40'),(120118214,1201182,1211,'6200吨，标准5200吨','2016-10-18 20:34:40'),(120118215,1201182,1212,'30节','2016-10-18 20:34:40'),(120118216,1201182,1202,'2002.10','2016-10-18 20:34:40'),(120118217,1201182,1200,'武汉','2016-10-18 20:34:40'),(120118218,1201182,1206,'169','2016-10-18 20:34:40'),(120118219,1201182,1006,'1','2016-10-18 20:34:40'),(120119101,1201191,1201,'2006.11.28','2016-10-18 20:34:44'),(120119102,1201191,1203,'大连造船厂','2016-10-18 20:34:44'),(120119103,1201191,1208,'驱逐舰051C型','2016-10-18 20:34:44'),(120119104,1201191,1204,'驱1支队','2016-10-18 20:34:44'),(120119105,1201191,1205,'北海舰队','2016-10-18 20:34:44'),(120119106,1201191,2000,'海军机动五号军事演习','2016-10-18 20:34:44'),(120119107,1201191,2000,'首舰::051C型驱逐舰','2016-10-18 20:34:44'),(120119108,1201191,2000,'115沈阳','2016-10-18 20:34:44'),(120119109,1201191,2000,'环日航行','2016-10-18 20:34:44'),(120119110,1201191,2000,'中俄海上联合军事演习','2016-10-18 20:34:44'),(120119111,1201191,2001,'2012.04.22-27日，中俄“海上联合-2012”军事演习在青岛附近黄海海域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军少将担任。中方参演兵力分别来自北海舰队、东海舰队和南海舰队，包括112哈尔滨、115沈阳、137福州、138泰州、139宁波、529舟山、530徐州、548益阳、527洛阳、528绵阳、881洪泽湖、和平方舟号医院船、2艘新型常规潜艇、4艘新一代导弹快艇等18艘舰艇。中国海军航空兵派出13架新型飞机和5架舰载直升机参演。俄方派出7艘舰艇参演。俄罗斯海军太平洋舰队将派出旗舰011瓦良格号巡洋舰，572维诺格拉多夫海军上将号、564特里布茨海军上将号和543沙波什尼科夫元帅号3艘无畏级反潜驱逐舰，佩琴加号中型海上油轮，以及2艘救援拖船参演。','2016-10-18 20:34:44'),(120119112,1201191,2001,'2013.07.02，7艘中国海军舰艇经过对马海峡北上，参加中俄“海上联合-2013”军事演习：115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡，从日本海驶向太平洋：115沈阳、116石家庄、546盐城、538烟台、881洪泽湖。2013.07.18，5艘中国军舰在日本东京都小笠原村聟岛北部海域向东南方向航行。随后，中国舰艇编队在聟岛以西270公里海域不断演练阵型，并在冲之鸟礁以北约400公里处海域进行了海上补给。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。','2016-10-18 20:34:44'),(120119113,1201191,2001,'2013.07.05-12日，中俄“海上联合-2013”军事演习在俄罗斯符拉迪沃斯托克海空域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军中将担任。中方舰艇编队指挥员北海舰队副司令杨骏飞少将率领。中方参演兵力由海军北海舰队和南海舰队7艘主力作战舰艇组成，包括115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。3架新型舰载直升机和1个特战分队也随舰远赴俄罗斯参加这次演习。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。俄方派出12艘舰艇参演。俄罗斯太平洋舰队主力舰艇悉数出动，包括太平洋舰队旗舰011瓦良格号巡洋舰、572维诺格拉多夫海军上将号大型反潜舰、715快速号导弹驱逐舰、毒蜘蛛级导弹快艇2艘和基洛级常规潜艇等，共计12艘。','2016-10-18 20:34:44'),(120119114,1201191,2001,'2013.10.18，中国海军在西太平洋海域举行代号为“机动五号”的远海实兵对抗演习。这次演习历时15天，出动北海舰队115沈阳、116石家庄、538烟台、东海舰队529舟山、530徐州、南海舰队168广州、570黄山等7艘水面舰船。','2016-10-18 20:34:44'),(120119115,1201191,2001,'2015.08.20-28日，根据中俄双方达成的共识，“海上联合-2015(Ⅱ)”军演在彼得大帝湾海域、克列尔卡角沿岸地区和日本海海空域举行。演习总导演分别由中国海军副司令员王海少将和俄罗斯海军副司令费多坚科夫中将担任。中方舰艇编队指挥员北海舰队副参谋长严正明海军大校。中方参演兵力由7艘水面舰艇、6架舰载直升机、5架固定翼飞机和200名陆战队员、21台两栖装备组成。7艘参演水面舰艇来自北海、东海、南海三大舰队，分别为115沈阳、138泰州、547临沂、568衡阳、989长白山、997云雾山、889太湖。据悉，上述舰艇均为三大舰队的现役主力战舰。9月初中俄联演结束后继续组织远海训练，5艘舰船在白令海航行并经塔纳加海峡进入西太平洋海域。于09.03到4日通过美国阿留申群岛间的国际海峡。这是中国人民解放军海军舰艇首次出现在该海域。','2016-10-18 20:34:44'),(120119116,1201191,2001,'首舰，051C型驱逐舰115号“沈阳”舰，2006.11.28服役。','2016-10-18 20:34:44'),(120119117,1201191,1210,'1165×17.1×6','2016-10-18 20:34:44'),(120119118,1201191,1211,'7100吨，标准6500吨','2016-10-18 20:34:44'),(120119119,1201191,1212,'30节','2016-10-18 20:34:44'),(120119120,1201191,1202,'2004.12.28','2016-10-18 20:34:44'),(120119121,1201191,1200,'沈阳','2016-10-18 20:34:44'),(120119122,1201191,1206,'115','2016-10-18 20:34:44'),(120119123,1201191,1006,'1','2016-10-18 20:34:44'),(120119201,1201192,1201,'2007.03','2016-10-18 20:34:48'),(120119202,1201192,1203,'大连造船厂','2016-10-18 20:34:48'),(120119203,1201192,1208,'驱逐舰051C型','2016-10-18 20:34:48'),(12011