4,2001,'2014.05.20-26日，中俄“海上联合-2014”军事演习在中国长江口以东的东海北部海空域举行。演习总导演分别由中国海军副司令员田中海军中将和俄海军副司令费多坚科夫海军中将担任，26日他们在设于上海某军港码头的联合导演部共同宣布：中俄“海上联合-2014”军事演习圆满结束。中方参演兵力以东海舰队为主，包括151郑州、112哈尔滨、139宁波、538烟台、573柳州、886千岛湖、某新型导弹快艇等水面舰艇8艘、潜艇2艘、固定翼飞机9架。俄方派出6艘舰艇参演。俄罗斯太平洋舰队旗舰011瓦良格号导弹巡洋舰、715快速号驱逐舰、548潘捷列耶夫海军上将号大型反潜舰、涅维尔斯科伊海军上将号大型登陆舰、伊利姆号中型海洋油船，卡拉尔号海洋拖船陆续驶入港口。','2016-10-18 20:35:11'),(120120410,1201204,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:35:11'),(120120411,1201204,2001,'2016.09.12-19日，根据中俄双方达成的共识，中俄两国海军将于9月在广东湛江以东海空域举行代号为“海上联合-2016”的联合军事演习。演习总导演分别由中国海军副司令员王海中将和俄罗斯海军副司令费多坚科夫中将担任。演习指挥员由南海舰队副司令员俞满江少将担任。中方的10艘演习舰艇以南海舰队兵力为主参加，包括168广州、151郑州、576大庆、574三亚、570黄山、998昆仑山、997云雾山、961军山湖、2艘新型常规潜艇。海军航空兵派出歼-11B战机、飞豹战机、预警机及多型舰载直升机等共计19架飞机参演。俄方的5艘演习舰艇2016.09.04已启程前往解放军海军湛江基地：564“无畏”级“特里布茨海军上将”号大型反潜舰、572“无畏”级“维诺格拉多夫海军上将”号大型反潜舰、077“蟾蜍”级“佩列斯韦特”号大型坦克登陆舰、“印古尔”级“阿拉套”号远洋拖船、“杜布纳”级“佩琴加”号中型远洋油船。','2016-10-18 20:35:11'),(120120412,1201204,1210,'155.5×17.2×6','2016-10-18 20:35:11'),(120120413,1201204,1211,'6900吨，标准5900吨','2016-10-18 20:35:11'),(120120414,1201204,1212,'30节','2016-10-18 20:35:11'),(120120415,1201204,1202,'2011.07.20','2016-10-18 20:35:11'),(120120416,1201204,1200,'郑州','2016-10-18 20:35:11'),(120120417,1201204,1206,'151','2016-10-18 20:35:11'),(120120418,1201204,1006,'1','2016-10-18 20:35:11'),(120120501,1201205,1201,'2014.12.22','2016-10-18 20:35:19'),(120120502,1201205,1203,'江南造船厂','2016-10-18 20:35:19'),(120120503,1201205,1208,'驱逐舰052C型','2016-10-18 20:35:19'),(120120504,1201205,1204,'驱6支队','2016-10-18 20:35:19'),(120120505,1201205,1205,'东海舰队','2016-10-18 20:35:19'),(120120506,1201205,2000,'152济南','2016-10-18 20:35:19'),(120120507,1201205,2000,'索马里护航','2016-10-18 20:35:19'),(120120508,1201205,2001,'护航编队#20，2015.04.03，中国海军第20批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2015.04.24护航开始，08.22护航结束，02.04归港。护航编队由152济南(2014.12.22)、548益阳(2010.10.26)、886千岛湖(2005.04.30)组成。编队指挥员东海舰队副参谋长王建勋大校(2016年海军少将)，编队政委东海舰队政治部副主任叶建林大校；800余人；共完成39批90艘次中外船舶的护航任务，驱离疑似海盗船11批13艘，利用护航间隙完成了对印度孟买的友好访问，同法国、巴基斯坦和韩国等国驱护舰艇进行青年军官交流见学，编队还与韩国第十九批护航编队指挥官会面，交流反海盗经验，深化护航行动合作；开始历时5个多月的环球访问，152舰艇编队先后访问了苏丹、埃及、丹麦、芬兰、瑞典、波兰、葡萄牙、美国、古巴、墨西哥、东帝汶、印度尼西亚等12国13港，技术停靠澳大利亚，并与埃及、丹麦、法国、美国、澳大利亚、印度尼西亚等国海军进行了联合军事演习，这次环球航行共历时309天，总航程达5.23万海里，开创了解放军海军一次任务靠泊16国18港，航经世界三大洋五大洲、25个海峡和三大运河的历史性壮举，任务航程之远、途径海域之广、时间跨度之长、访问国家之多、中外联演频率之高均创海军历史之最。','2016-10-18 20:35:19'),(120120509,1201205,1210,'155.5×17.2×6','2016-10-18 20:35:19'),(120120510,1201205,1211,'6900吨，标准5900吨','2016-10-18 20:35:19'),(120120511,1201205,1212,'30节','2016-10-18 20:35:19'),(120120512,1201205,1202,'2012.01','2016-10-18 20:35:19'),(120120513,1201205,1200,'济南','2016-10-18 20:35:19'),(120120514,1201205,1206,'152','2016-10-18 20:35:19'),(120120515,1201205,1006,'1','2016-10-18 20:35:19'),(120120601,1201206,1201,'2015.02.09','2016-10-18 20:35:24'),(120120602,1201206,1203,'江南造船厂','2016-10-18 20:35:24'),(120120603,1201206,1208,'驱逐舰052C型','2016-10-18 20:35:24'),(120120604,1201206,1204,'驱6支队','2016-10-18 20:35:24'),(120120605,1201206,1205,'东海舰队','2016-10-18 20:35:24'),(120120606,1201206,2000,'尾舰::052C型驱逐舰','2016-10-18 20:35:24'),(120120607,1201206,2000,'153西安','2016-10-18 20:35:24'),(120120608,1201206,2000,'环太平洋军事演习','2016-10-18 20:35:24'),(120120609,1201206,2000,'环日航行','2016-10-18 20:35:24'),(120120610,1201206,2001,'2016.06.16，5艘中国舰艇凌晨通过宫古海峡从东海向太平洋航行，参加“环太平洋—2016”演习：153西安、572衡水、966高邮湖、867长岛、和平方舟医院船。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海，途中密集进行了综合攻防操演、直升机起降、航行补给等多个科目的训练：153西安、572衡水、966高邮湖。2016.08.16，3艘中国舰艇傍晚在对马海峡西北约15公里处海域向东北偏北方向航行，进入日本海：532荆州、578扬州、886千岛湖。同日，俄罗斯海军导弹驱逐舰548“潘捷列耶夫海军上将号”穿过宗谷海峡后继续向东航行。2016.08.18，双方展开了实兵对抗演练，演练现场红蓝双方你攻我打，在遭受红方的海空协同突击后，担任蓝方的西安舰编队迅速展开反击，红方舰艇编队立即组织立体防御，现场充满了浓浓的火药味。08.18，中国海军航空兵运8警戒机一架，轰6轰炸机2架经由对马海峡飞入日本海上空。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行：153西安、572衡水、966高邮湖。','2016-10-18 20:35:24'),(120120611,1201206,2001,'2016.06.30-08.04，第25届环太平洋军事演习(RIMPAC)预计在夏威夷群岛和加利福尼亚州及其附近地区举行。包括美国和中国在内27个国家、45艘船舰、5艘潜水艇、200多架飞机和25000名人员将参加这一世界上规模最大的国际海上军演。中国海军参加“环太平洋—2016”演习兵力由153西安、572衡水、966高邮湖、867长岛、和平方舟医院船及3架舰载直升机、1个特战分队、1个潜水分队组成。根据中美两国达成的共识，中方此次将参加火炮射击、海上补给、损管救援、反海盗、舰机协同突击、搜索救援、潜水、援潜救生等科目演练。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行，完成环日航行。','2016-10-18 20:35:24'),(120120612,1201206,1210,'155.5×17.2×6','2016-10-18 20:35:24'),(120120613,1201206,1211,'6900吨，标准5900吨','2016-10-18 20:35:24'),(120120614,1201206,1212,'30节','2016-10-18 20:35:24'),(120120615,1201206,1202,'2012.07','2016-10-18 20:35:24'),(120120616,1201206,1200,'西安','2016-10-18 20:35:24'),(120120617,1201206,1206,'153','2016-10-18 20:35:24'),(120120618,1201206,1006,'1','2016-10-18 20:35:24'),(120125101,1201251,1201,'2014.03.21','2016-10-18 20:35:30'),(120125102,1201251,1203,'江南造船厂','2016-10-18 20:35:30'),(120125103,1201251,1208,'驱逐舰052D型','2016-10-18 20:35:30'),(120125104,1201251,1204,'驱9支队','2016-10-18 20:35:30'),(120125105,1201251,1205,'南海舰队','2016-10-18 20:35:30'),(120125106,1201251,2000,'首舰::052D型驱逐舰','2016-10-18 20:35:30'),(120125107,1201251,2000,'172昆明','2016-10-18 20:35:30'),(120125108,1201251,2001,'首舰，052D型驱逐舰172号“昆明”舰，2014.03.21服役。','2016-10-18 20:35:30'),(120125109,1201251,1210,'156×18×6','2016-10-18 20:35:30'),(120125110,1201251,1211,'7500吨','2016-10-18 20:35:30'),(120125111,1201251,1202,'2012.08.30','2016-10-18 20:35:30'),(120125112,1201251,1200,'昆明','2016-10-18 20:35:30'),(120125113,1201251,1206,'172','2016-10-18 20:35:30'),(120125114,1201251,1006,'1','2016-10-18 20:35:30'),(120125201,1201252,1201,'2015.08.12','2016-10-18 20:35:37'),(120125202,1201252,1203,'江南造船厂','2016-10-18 20:35:37'),(120125203,1201252,1208,'驱逐舰052D型','2016-10-18 20:35:37'),(120125204,1201252,1204,'驱9支队','2016-10-18 20:35:37'),(120125205,1201252,1205,'南海舰队','2016-10-18 20:35:37'),(120125206,1201252,2000,'173长沙','2016-10-18 20:35:37'),(120125207,1201252,1210,'156×18×6','2016-10-18 20:35:37'),(120125208,1201252,1211,'7500吨','2016-10-18 20:35:37'),(120125209,1201252,1202,'2012.12.18