海舰队驻浙江舟山某军港解缆起航，执行护航任务。2010.11.17护航开始，03.22护航结束，05.09归港。护航编队由529舟山(2008.01.03)、530徐州(2008.01.27)、886千岛湖(2005.04.30)组成。编队指挥员东海舰队副司令员张华臣少将，编队政委东海舰队政治部副主任李建军大校；780余人；安全护送38批578艘中外船舶，接护遭海盗袭击船舶1艘，营救遭海盗登船袭击船舶1艘，解救被海盗追击船舶6次9艘，查证和驱离可疑船只218艘次，并圆满完成远赴利比亚为撤离中国受困人员船舶实施护航任务；坦桑尼亚、南非、塞舌尔','2016-10-18 20:44:01'),(120531117,1205311,2001,'护航编队#23，2016.04.07，中国海军第23批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2016.04.29护航开始，09.02护航结束，11.01归港。护航编队由531湘潭(2016.02.24)、529舟山(2008.01.03)、890巢湖(2013.09.12)组成。编队指挥员东海舰队副参谋长王红理大校，编队政委东海舰队政治工作部副主任秦威大校；700余人；完成了39批79艘中外船舶护航任务，驱离疑似海盗船7批41艘，继续保持了被护船舶和自身的两个“百分之百”安全，护航期间湘潭舰代表中国海军远赴德国参加了于06.17-26举办的“基尔周”活动，这是中国海军首次派舰参加该活动；德国、缅甸、马来西亚、柬埔寨、越南','2016-10-18 20:44:01'),(120531118,1205311,2001,'首舰，054A型护卫舰529号“舟山”舰，2008.01.03服役。','2016-10-18 20:44:01'),(120531119,1205311,1210,'134.1×16×4.5','2016-10-18 20:44:01'),(120531120,1205311,1211,'4053吨，标准3600吨','2016-10-18 20:44:01'),(120531121,1205311,1212,'27节','2016-10-18 20:44:01'),(120531122,1205311,1202,'2006.12.21','2016-10-18 20:44:01'),(120531123,1205311,1200,'舟山','2016-10-18 20:44:01'),(120531124,1205311,1206,'529','2016-10-18 20:44:01'),(120531125,1205311,1006,'1','2016-10-18 20:44:01'),(120531201,1205312,1201,'2008.01.27','2016-10-18 20:44:04'),(120531202,1205312,1203,'黄埔造船厂','2016-10-18 20:44:04'),(120531203,1205312,1208,'护卫舰054A型','2016-10-18 20:44:04'),(120531204,1205312,1204,'驱3支队','2016-10-18 20:44:04'),(120531205,1205312,1205,'东海舰队','2016-10-18 20:44:04'),(120531206,1205312,2000,'中俄海上联合军事演习','2016-10-18 20:44:04'),(120531207,1205312,2000,'530徐州','2016-10-18 20:44:04'),(120531208,1205312,2000,'海军机动五号军事演习','2016-10-18 20:44:04'),(120531209,1205312,2000,'索马里护航','2016-10-18 20:44:04'),(120531210,1205312,2001,'2012.04.22-27日，中俄“海上联合-2012”军事演习在青岛附近黄海海域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军少将担任。中方参演兵力分别来自北海舰队、东海舰队和南海舰队，包括112哈尔滨、115沈阳、137福州、138泰州、139宁波、529舟山、530徐州、548益阳、527洛阳、528绵阳、881洪泽湖、和平方舟号医院船、2艘新型常规潜艇、4艘新一代导弹快艇等18艘舰艇。中国海军航空兵派出13架新型飞机和5架舰载直升机参演。俄方派出7艘舰艇参演。俄罗斯海军太平洋舰队将派出旗舰011瓦良格号巡洋舰，572维诺格拉多夫海军上将号、564特里布茨海军上将号和543沙波什尼