120531611,1205316,1211,'4053吨，标准3600吨','2016-10-18 20:44:24'),(120531612,1205316,1212,'27节','2016-10-18 20:44:24'),(120531613,1205316,1202,'2009.02.08','2016-10-18 20:44:24'),(120531614,1205316,1200,'运城','2016-10-18 20:44:24'),(120531615,1205316,1206,'571','2016-10-18 20:44:24'),(120531616,1205316,1006,'1','2016-10-18 20:44:24'),(120531701,1205317,1201,'2010.10.26','2016-10-18 20:44:30'),(120531702,1205317,1203,'黄埔造船厂','2016-10-18 20:44:30'),(120531703,1205317,1208,'护卫舰054A型','2016-10-18 20:44:30'),(120531704,1205317,1204,'驱6支队','2016-10-18 20:44:30'),(120531705,1205317,1205,'东海舰队','2016-10-18 20:44:30'),(120531706,1205317,2000,'中俄海上联合军事演习','2016-10-18 20:44:30'),(120531707,1205317,2000,'海军机动六号军事演习','2016-10-18 20:44:30'),(120531708,1205317,2000,'548益阳','2016-10-18 20:44:30'),(120531709,1205317,2000,'索马里护航','2016-10-18 20:44:30'),(120531710,1205317,2001,'2012.04.22-27日，中俄“海上联合-2012”军事演习在青岛附近黄海海域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军少将担任。中方参演兵力分别来自北海舰队、东海舰队和南海舰队，包括112哈尔滨、115沈阳、137福州、138泰州、139宁波、529舟山、530徐州、548益阳、527洛阳、528绵阳、881洪泽湖、和平方舟号医院船、2艘新型常规潜艇、4艘新一代导弹快艇等18艘舰艇。中国海军航空兵派出13架新型飞机和5架舰载直升机参演。俄方派出7艘舰艇参演。俄罗斯海军太平洋舰队将派出旗舰011瓦良格号巡洋舰，572维诺格拉多夫海军上将号、564特里布茨海军上将号和543沙波什尼科夫元帅号3艘无畏级反潜驱逐舰，佩琴加号中型海上油轮，以及2艘救援拖船参演。','2016-10-18 20:44:30'),(120531711,1205317,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:44:30'),(120531712,1205317,2001,'护航编队#12，2012.07.03，中国海军第12批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2012.07.18护航开始，11.27护航结束，01.19归港。护航编队由548益阳(2010.10.26)、549常州(2011.05.30)、886千岛湖(2005.04.30)组成。编队指挥员东海舰队副参谋长周煦明少将，编队政委海军某驱逐舰支队政委翟永远大校(2016年海军少将)；790余人；历时201天，航程12449海里，完成了46批204艘中外船舶护航任务，查证、驱离可疑船只35批62艘次；澳大利亚、越南','2016-10-18 20:44:30'),(120531713,1205317,2001,'护航编队#20，2015.04.03，中国海军第20批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2015.04.24护航开始，08.22护航结束，02.04归港。护航编队由152济南(2014.12.22)、548益阳(2010.10.26)、886千岛湖(2005.04.30)组成。编队指挥员东海舰队副参谋长王建勋大校(2016年海军少将)，编队政委东海舰队政治部副主任叶建林大校；800余人；共完成39批90艘次中外船舶的护航任务，驱离疑似海盗船11批13艘，利用护航间隙完成了对印度孟买的友好访问，同法国、巴基斯坦和韩国等国驱护舰艇进行青年军官交流见学，编队还与韩国第十九批护航编队指挥官会面，交流反海盗经验，深化护航行动合作；开始历时5个多月的环球访问，152舰艇编队先后访问了苏丹、埃及、丹麦、芬兰、瑞典、波兰、葡萄牙、美国、古巴、墨西哥、东帝汶、印度尼西亚等12国13港，技术停靠澳大利亚，并与埃及、丹麦、法国、美国、澳大利亚、印度尼西亚等国海军进行了联合军事演习，这次环球航行共历时309天，总航程达5.23万海里，开创了解放军海军一次任务靠泊16国18港，航经世界三大洋五大洲、25个海峡和三大运河的历史性壮举，任务航程之远、途径海域之广、时间跨度之长、访问国家之多、中外联演频率之高均创海军历史之最。','2016-10-18 20:44:30'),(120531714,1205317,1210,'134.1×16×4.5','2016-10-18 20:44:30'),(120531715,1205317,1211,'4053吨，标准3600吨','2016-10-18 20:44:30'),(120531716,1205317,1212,'27节','2016-10-18 20:44:30'),(120531717,1205317,1202,'2009.11.17','2016-10-18 20:44:30'),(120531718,1205317,1200,'益阳','2016-10-18 20:44:30'),(120531719,1205317,1206,'548','2016-10-18 20:44:30'),(120531720,1205317,1006,'1','2016-10-18 20:44:30'),(120531801,1205318,1201,'2011.05.30','2016-10-18 20:44:34'),(120531802,1205318,1203,'沪东造船厂','2016-10-18 20:44:34'),(120531803,1205318,1208,'护卫舰054A型','2016-10-18 20:44:34'),(120531804,1205318,1204,'驱6支队','2016-10-18 20:44:34'),(120531805,1205318,1205,'东海舰队','2016-10-18 20:44:34'),(120531806,1205318,2000,'549常州','2016-10-18 20:44:34'),(120531807,1205318,2000,'索马里护航','2016-10-18 20:44:34'),(120531808,1205318,2001,'护航编队#12，2012.07.03，中国海军第12批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2012.07.18护航开始，11.27护航结束，01.19归港。护航编队由548益阳(2010.10.26)、549常州(2011.05.30)、886千岛湖(2005.04.30)组成。编队指挥员东海舰队副参谋长周煦明少将，编队政委海军某驱逐舰支队政委翟永远大校(2016年海军少将)；790余人；历时201天，航程12449海里，完成了46批204艘中外船舶护航任务，查证、驱离可疑船只35批62艘次；澳大利亚、越南','2016-10-18 20:44:34'),(120531809,1205318,2001,'护航编队#17，2014.03.24，中国海军第17批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2014.04.18护航开始，08.28护航结束，10.22归港。护航编队由150长春(2013.01.31)、549常州(2011.05.30)、890巢湖(2013.09.12)组成。编队指挥员东海舰队副参谋长黄新建少将，编队政委东海舰队政治部副主任傅耀泉大校(2016年海军少将)；810余人；共完成43批115艘中外船舶护航任务，为17艘次船舶实施特殊护航，为1艘世界粮食计划署船舶护航，先后参与了援救韩海军舰艇失踪船员、营救意大利失火商船等行动；约旦、阿联酋、伊朗、巴基斯坦四国','2016-10-18 20:44:34'),(120531810,1205318,1210,'134.1×16×4.5','2016-10-18 20:44:34'),(120531811,1205318,1211,'4053吨，标准3600吨','2016-10-18 20:44:34'),(120531812,1205318,1212,'27节','2016-10-18 20:44:34'),(120531813,1205318,1202,'2010.05.18','2016-10-18 20:44:34'),(120531814,1205318,1200,'常州','2016-10-18 20:44:34'),(120531815,1205318,1206,'549','2016-10-18 20:44:34'),(120531816,1205318,1006,'1','2016-10-18 20:44:34'),(120531901,1205319,1201,'2011.07.30','2016-10-18 20:44:36'),(120531902,1205319,1203,'黄埔造船厂','2016-10-18 20:44:36'),(120531903,1205319,1208,'护卫舰054A型','2016-10-18 20:44:36'),(120531904,1205319,1204,'驱1支队','2016-10-18 20:44:36'),(120531905,1205319,1205,'北海舰队','2016-10-18 20:44:36'),(120531906,1205319,2000,'538烟台','2016-10-18 20:44:36'),(120531907,1205319,2000,'中俄海上联合军事演习','2016-10-18 20:44:36'),(120531908,1205319,2000,'海军机动五号军事演习','2016-10-18 20:44:36'),(120531909,1205319,2000,'海军机动六号军事演习','2016-10-18 20:44:36'),(120531910,1205319,2000,'环日航行','2016-10-18 20:44:36'),(120531911,1205319,2000,'索马里护航','2016-10-18 20:44:36'),(120531912,1205319,2001,'2013.07.02，7艘中国海军舰艇经过对马海峡北上，参加中俄“海上联合-2013”军事演习：115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡，从日本海驶向太平洋：115沈阳、116石家庄、546盐城、538烟台、881洪泽湖。2013.07.18，5艘中国军舰在日本东京都小笠原村聟岛北部海域向东南方向航行。随后，中国舰艇编队在聟岛以西270公里海域不断演练阵型，并在冲之鸟礁以北约400公里处海域进行了海上补给。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。','2016-10-18 20:44:36'),(120531913,1205319,2001,'2013.07.05-12日，中俄“海上联合-2013”军事演习在俄罗斯符拉迪沃斯托克海空域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军中将担任。中方舰艇编队指挥员北海舰队副司令杨骏飞少将率领。中方参演兵力由海军北海舰队和南海舰队7艘主力作战舰艇组成，包括115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。3架新型舰载直升机和1个特战分队也随舰远赴俄罗斯参加这次演习。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。俄方派出12艘舰艇参演。俄罗斯太平洋舰队主力舰艇悉数出动，包括太平洋舰队旗舰011瓦良格号巡洋舰、572维诺格拉多夫海军上将号大型反潜舰、715快速号导弹驱逐舰、毒蜘蛛级导弹快艇2艘和基洛级常规潜艇等，共计12艘。','2016-10-18 20:44:36'),(120531914,1205319,2001,'2013.10.18，中国海军在西太平洋海域举行代号为“机动五号”的远海实兵对抗演习。这次演习历时15天，出动北海舰队115沈阳、116石家庄、538烟台、东海舰队529舟山、530徐州、南海舰队168广州、570黄山等7艘水面舰船。','2016-10-18 20:44:36'),(120531915,1205319,2001,'2014.05.20-26日，中俄“海上联合-2014”军事演习在中国长江口以东的东海北部海空域举行。演习总导演分别由中国海军副司令员田中海军中将和俄海军副司令费多坚科夫海军中将担任，26日他们在设于上海某军港码头的联合导演部共同宣布：中俄“海上联合-2014”军事演习圆满结束。中方参演兵力以东海舰队为主，包括151郑州、112哈尔滨、139宁波、538烟台、573柳州、886千岛湖、某新型导弹快艇等水面舰艇8艘、潜艇2艘、固定翼飞机9架。俄方派出6艘舰艇参演。俄罗斯太平洋舰队旗舰011瓦良格号导弹巡洋舰、715快速号驱逐舰、548潘捷列耶夫海军上将号大型反潜舰、涅维尔斯科伊海军上将号大型登陆舰、伊利姆号中型海洋油船，卡拉尔号海洋拖船陆续驶入港口。','2016-10-18 20:44:36'),(120531916,1205319,2001,'2014.12.04，5艘中国舰艇通过大隅海峡向东航行，随后在西太平洋参加机动六号军事演习：北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖。其中116石家庄于2014.12.15穿过宫古海峡进入东海。2014.12.25，4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，这支舰队接下来很可能穿过日本海，经朝鲜海峡返回位于山东的北海舰队基地，其航迹绕将日本一圈：112哈尔滨、538烟台、546盐城、889太湖。2014.12.28，对于正在绕行日本返回中国本土的中国海军舰艇编队，日本称已经表现出了高度的警戒。周六下午2点30分左右，日本海上自卫队第4护卫队群“凉月”号驱逐舰和第4航空群所属P-3C反潜机，在对马海峡东北约300公里的海域对中国海军舰艇编队进行了持续跟踪拍摄。','2016-10-18 20:44:36'),(120531917,1205319,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:44:36'),(120531918,1205319,2001,'2016.01.26，4艘中国舰艇穿越对马海峡向东进入日本海：112哈尔滨、538烟台、881洪泽湖、854天狼星。2016.02.02，4艘中国舰艇通过津轻海峡横穿日本列岛。2016.02.16，日本自卫队发现中国海军编队穿越大隅海峡向西航行，绕日本近一周后返回东海。','2016-10-18 20:44:36'),(120531919,1205319,2001,'护航编队#11，2012.02.27，中国海军第11批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2012.03.15护航开始，07.23护航结束，09.13归港。护航编队由113青岛(1996.05.28)、538烟台(2011.07.30)、887微山湖(2004.04.18)组成。编队指挥员北海舰队副参谋长杨骏飞少将，编队政委北海舰队政治部副主任夏克伟少将；800余人；安全护送43批184艘中外船舶(其中，中国大陆船舶51艘，香港地区船舶14艘，台湾地区船舶1艘，外国船舶118艘)，驱离可疑海盗船只58批126艘，共成功处置突发情况70多起，解救遭疑似海盗船追击的中外船只3艘，及时为4艘中外商船伤病船员提供了医疗救助，协助中国“集美贵”轮修复了设备故障；乌克兰、罗马尼亚、土耳其、保加利亚、以色列','2016-10-18 20:44:36'),(120531920,1205319,1210,'134.1×16×4.5','2016-10-18 20:44:36'),(120531921,1205319,1211,'4053吨，标准3600吨','2016-10-18 20:44:36'),(120531922,1205319,1212,'27节','2016-10-18 20:44:36'),(120531923,1205319,1202,'2010.08.24','2016-10-18 20:44:36'),(120531924,1205319,1200,'烟台','2016-10-18 20:44:36'),(120531925,1205319,1206,'538','2016-10-18 20:44:36'),(120531926,1205319,1006,'1','2016-10-18 20:44:36'),(120532001,1205320,1201,'2012.06.05','2016-10-18 20:44:40'),(120532002,1205320,1203,'沪东造船厂','2016-10-18 20:44:40'),(120532003,1205320,1208,'护卫舰054A型','2016-10-18 20:44:40'),(120532004,1205320,1204,'驱1支队','2016-10-18 20:44:40'),(120532005,1205320,1205,'北海舰队','2016-10-18 20:44:40'),(120532006,1205320,2000,'中俄海上联合军事演习','2016-10-18 20:44:40'),(120532007,1205320,2000,'546盐城','2016-10-18 20:44:40'),(120532008,1205320,2000,'叙化武海运护航','2016-10-18 20:44:40'),(120532009,1205320,2000,'海军机动六号军事演习','2016-10-18 20:44:40'),(120532010,1205320,2000,'环日航行','2016-10-18 20:44:40'),(120532011,1205320,2000,'索马里护航','2016-10-18 20:44:40'),(120532012,1205320,2001,'2013.07.02，7艘中国海军舰艇经过对马海峡北上，参加中俄“海上联合-2013”军事演习：115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡，从日本海驶向太平洋：115沈阳、116石家庄、546盐城、538烟台、881洪泽湖。2013.07.18，5艘中国军舰在日本东京都小笠原村聟岛北部海域向东南方向航行。随后，中国舰艇编队在聟岛以西270公里海域不断演练阵型，并在冲之鸟礁以北约400公里处海域进行了海上补给。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。','2016-10-18 20:44:40'),(120532013,1205320,2001,'2013.07.05-12日，中俄“海上联合-2013”军事演习在俄罗斯符拉迪沃斯托克海空域举行。演习总导演分别由中国海军副司令员丁一平海军中将和俄海军副参谋长苏哈诺夫海军中将担任。中方舰艇编队指挥员北海舰队副司令杨骏飞少将率领。中方参演兵力由海军北海舰队和南海舰队7艘主力作战舰艇组成，包括115沈阳、116石家庄、169武汉、170兰州、546盐城、538烟台、881洪泽湖。3架新型舰载直升机和1个特战分队也随舰远赴俄罗斯参加这次演习。2013.07.14，5艘中国海军舰艇和16艘俄罗斯海军舰艇，于当日通过了位于日本北海道和俄罗斯萨哈林岛之间的宗谷海峡。2013.07.25，5艘中国海军舰艇下午6点左右穿过日本冲绳本岛与宫古岛之间的敏感海域，沿公海水道进入东海。中国这支海军舰队已经完成了绕日本列岛一周的航行。这是中国海军舰队首次环绕日本航行。俄方派出12艘舰艇参演。俄罗斯太平洋舰队主力舰艇悉数出动，包括太平洋舰队旗舰011瓦良格号巡洋舰、572维诺格拉多夫海军上将号大型反潜舰、715快速号导弹驱逐舰、毒蜘蛛级导弹快艇2艘和基洛级常规潜艇等，共计12艘。','2016-10-18 20:44:40'),(120532014,1205320,2001,'2013.12.31，正在担负第十六批亚丁湾护航任务的中国海军盐城舰从沙特吉达港起航，转战千里奔赴地中海完成了7批护航任务。','2016-10-18 20:44:40'),(120532015,1205320,2001,'2014.12.04，5艘中国舰艇通过大隅海峡向东航行，随后在西太平洋参加机动六号军事演习：北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖。其中116石家庄于2014.12.15穿过宫古海峡进入东海。2014.12.25，4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，这支舰队接下来很可能穿过日本海，经朝鲜海峡返回位于山东的北海舰队基地，其航迹绕将日本一圈：112哈尔滨、538烟台、546盐城、889太湖。2014.12.28，对于正在绕行日本返回中国本土的中国海军舰艇编队，日本称已经表现出了高度的警戒。周六下午2点30分左右，日本海上自卫队第4护卫队群“凉月”号驱逐舰和第4航空群所属P-3C反潜机，在对马海峡东北约300公里的海域对中国海军舰艇编队进行了持续跟踪拍摄。','2016-10-18 20:44:40'),(120532016,1205320,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:44:40'),(120532017,1205320,2001,'护航编队#16，2013.11.30，中国海军第16批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2013.12.21护航开始，04.24护航结束，07.18归港。护航编队由546盐城(2012.06.05)、527洛阳(2005.09)、889太湖(2013.06.18)组成。编队指挥员北海舰队副参谋长李鹏程少将，编队政委北海舰队某驱逐舰支队政委孙健大校；660余人；共完成40批132艘中外船舶护航任务，先后派出特战队员53人次为18艘次船舶实施随船护卫，解救遭海盗袭扰商船1艘；突尼斯、科特迪瓦、喀麦隆','2016-10-18 20:44:40'),(120532018,1205320,1210,'134.1×16×4.5','2016-10-18 20:44:40'),(120532019,1205320,1211,'4053吨，标准3600吨','2016-10-18 20:44:40'),(120532020,1205320,1212,'27节','2016-10-18 20:44:40'),(120532021,1205320,1202,'2011.04.27','2016-10-18 20:44:40'),(120532022,1205320,1200,'盐城','2016-10-18 20:44:40'),(120532023,1205320,1206,'546','2016-10-18 20:44:40'),(120532024,1205320,1006,'1','2016-10-18 20:44:40'),(120532101,1205321,1201,'2012.07.09','2016-10-18 20:44:44'),(120532102,1205321,1203,'黄埔造船厂','2016-10-18 20:44:44'),(120532103,1205321,1208,'护卫舰054A型','2016-10-18 20:44:44'),(120532104,1205321,1204,'驱9支队','2016-10-18 20:44:44'),(120532105,1205321,1205,'南海舰队','2016-10-18 20:44:44'),(120532106,1205321,2000,'572衡水','2016-10-18 20:44:44'),(120532107,1205321,2000,'环太平洋军事演习','2016-10-18 20:44:44'),(120532108,1205321,2000,'环日航行','2016-10-18 20:44:44'),(120532109,1205321,2000,'索马里护航','2016-10-18 20:44:44'),(120532110,1205321,2001,'2016.06.16，5艘中国舰艇凌晨通过宫古海峡从东海向太平洋航行，参加“环太平洋—2016”演习：153西安、572衡水、966高邮湖、867长岛、和平方舟医院船。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海，途中密集进行了综合攻防操演、直升机起降、航行补给等多个科目的训练：153西安、572衡水、966高邮湖。2016.08.16，3艘中国舰艇傍晚在对马海峡西北约15公里处海域向东北偏北方向航行，进入日本海：532荆州、578扬州、886千岛湖。同日，俄罗斯海军导弹驱逐舰548“潘捷列耶夫海军上将号”穿过宗谷海峡后继续向东航行。2016.08.18，双方展开了实兵对抗演练，演练现场红蓝双方你攻我打，在遭受红方的海空协同突击后，担任蓝方的西安舰编队迅速展开反击，红方舰艇编队立即组织立体防御，现场充满了浓浓的火药味。08.18，中国海军航空兵运8警戒机一架，轰6轰炸机2架经由对马海峡飞入日本海上空。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行：153西安、572衡水、966高邮湖。','2016-10-18 20:44:44'),(120532111,1205321,2001,'2016.06.30-08.04，第25届环太平洋军事演习(RIMPAC)预计在夏威夷群岛和加利福尼亚州及其附近地区举行。包括美国和中国在内27个国家、45艘船舰、5艘潜水艇、200多架飞机和25000名人员将参加这一世界上规模最大的国际海上军演。中国海军参加“环太平洋—2016”演习兵力由153西安、572衡水、966高邮湖、867长岛、和平方舟医院船及3架舰载直升机、1个特战分队、1个潜水分队组成。根据中美两国达成的共识，中方此次将参加火炮射击、海上补给、损管救援、反海盗、舰机协同突击、搜索救援、潜水、援潜救生等科目演练。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行，完成环日航行。','2016-10-18 20:44:44'),(120532112,1205321,2001,'护航编队#15，2013.08.08，中国海军第15批护航编队从南海舰队驻广东湛江某军港解缆起航，执行护航任务。2013.08.21护航开始，12.22护航结束，01.23归港。护航编队由999井冈山(2011.10.30)、572衡水(2012.07.09)、889太湖(2013.06.18)组成。编队指挥员南海舰队装备部部长姜中华少将(2014.09.02宁波跳楼自杀)，编队政委南海舰队某登陆舰支队政委肖民生大校；800余人；完成46批181艘中外船舶的护航任务，护送联合国粮食计划署船舶1艘；坦桑尼亚、肯尼亚、斯里兰卡','2016-10-18 20:44:44'),(120532113,1205321,1210,'134.1×16×4.5','2016-10-18 20:44:44'),(120532114,1205321,1211,'4053吨，标准3600吨','2016-10-18 20:44:44'),(120532115,1205321,1212,'27节','2016-10-18 20:44:44'),(120532116,1205321,1202,'2011.05.21','2016-10-18 20:44:44'),(120532117,1205321,1200,'衡水','2016-10-18 20:44:44'),(120532118,1205321,1206,'572','2016-10-18 20:44:44'),(120532119,1205321,1006,'1','2016-10-18 20:44:44'),(120532201,1205322,1201,'2012.12.26','2016-10-18 20:44:51'),(120532202,1205322,1203,'沪东造船厂','2016-10-18 20:44:51'),(120532203,1205322,1208,'护卫舰054A型','2016-10-18 20:44:51'),(120532204,1205322,1204,'驱9支队','2016-10-18 20:44:51'),(120532205,1205322,1205,'南海舰队','2016-10-18 20:44:51'),(120532206,1205322,2000,'中俄海上联合军事演习','2016-10-18 20:44:51'),(120532207,1205322,2000,'573柳州','2016-10-18 20:44:51'),(120532208,1205322,2000,'海军机动六号军事演习','2016-10-18 20:44:51'),(120532209,1205322,2000,'索马里护航','2016-10-18 20:44:51'),(120532210,1205322,2001,'2014.05.20-26日，中俄“海上联合-2014”军事演习在中国长江口以东的东海北部海空域举行。演习总导演分别由中国海军副司令员田中海军中将和俄海军副司令费多坚科夫海军中将担任，26日他们在设于上海某军港码头的联合导演部共同宣布：中俄“海上联合-2014”军事演习圆满结束。中方参演兵力以东海舰队为主，包括151郑州、112哈尔滨、139宁波、538烟台、573柳州、886千岛湖、某新型导弹快艇等水面舰艇8艘、潜艇2艘、固定翼飞机9架。俄方派出6艘舰艇参演。俄罗斯太平洋舰队旗舰011瓦良格号导弹巡洋舰、715快速号驱逐舰、548潘捷列耶夫海军上将号大型反潜舰、涅维尔斯科伊海军上将号大型登陆舰、伊利姆号中型海洋油船，卡拉尔号海洋拖船陆续驶入港口。','2016-10-18 20:44:51'),(120532211,1205322,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:44:51'),(120532212,1205322,2001,'护航编队#21，2015.08.04，中国海军第21批护航编队从南海舰队驻海南三亚某军港解缆起航，执行护航任务。2015.08.22护航开始，01.03护航结束，03.08归港。护航编队由573柳州(2012.12.26)、574三亚(2013.12.13)、885青海湖(1996.06)组成。编队指挥员南海舰队副参谋长俞满江少将，编队政委南海舰队某水警区政委何清凤大校；700余人；共执行35批64艘中外船舶的护航任务，驱离疑似海盗船只12批56艘，确保了护航船舶和编队自身安全。其间，编队与北约508编队、韩国海军第19批护航编队举行了联合反海盗演练，与欧盟465编队、韩国海军护航编队举行了指挥官会晤，同丹麦、意大利、韩国海军舰艇进行青年军官交流见学，进一步拓展了国际合作；亚洲六国','2016-10-18 20:44:51'),(120532213,1205322,1210,'134.1×16×4.5','2016-10-18 20:44:51'),(120532214,1205322,1211,'4053吨，标准3600吨','2016-10-18 20:44:51'),(120532215,1205322,1212,'27节','2016-10-18 20:44:51'),(120532216,1205322,1202,'2011.12.10','2016-10-18 20:44:51'),(120532217,1205322,1200,'柳州','2016-10-18 20:44:51'),(120532218,1205322,1206,'573','2016-10-18 20:44:51'),(120532219,1205322,1006,'1','2016-10-18 20:44:51'),(120532301,1205323,1201,'2012.11.22','2016-10-18 20:44:57'),(120532302,1205323,1203,'黄埔造船厂','2016-10-18 20:44:57'),(120532303,1205323,1208,'护卫舰054A型','2016-10-18 20:44:57'),(120532304,1205323,1204,'驱1支队','2016-10-18 20:44:57'),(120532305,1205323,1205,'北海舰队','2016-10-18 20:44:57'),(120532306,1205323,2000,'中俄海上联合军事演习','2016-10-18 20:44:57'),(120532307,1205323,2000,'547临沂','2016-10-18 20:44:57'),(120532308,1205323,2000,'也门撤侨','2016-10-18 20:44:57'),(120532309,1205323,2000,'索马里护航','2016-10-18 20:44:57'),(120532310,1205323,2001,'2015.03.29-04.07，中国海军第十九批护航舰艇编队547临沂、550潍坊、887微山湖赶赴也门，执行撤离中国在也门人员任务。中国海军护航编队共执行了4次撤离任务，成功从也门撤离了中国公民600多人，以及来自15个国家的外国公民279人。2015.05.11-21日，三舰参加中俄两国海军在地中海海域进行代号为“海上联合-2015(Ⅰ)”的联合军事演习。','2016-10-18 20:44:57'),(120532311,1205323,2001,'2015.05.11-21日，中俄两国海军在地中海海域进行代号为“海上联合-2015(Ⅰ)”的联合军事演习。演习总导演分别由中国海军副司令员杜景臣海军中将和俄海军副司令费多坚科夫海军中将担任，11日上午他们在新罗西斯克市34号码头共同宣布演习开始。中国海军派出547临沂、550潍坊、887微山湖参加此次演习。三舰是结束第十九批护航任务后，未经休整即开赴参加这次演习的。俄罗斯海军则派出了121莫斯科号巡洋舰、顺利号护卫舰、西蒙风号导弹气垫艇、A·沙巴林号大型登陆舰、A·奥特拉科夫斯基号大型登陆舰和一艘海洋拖船参演。','2016-10-18 20:44:57'),(120532312,1205323,2001,'2015.08.20-28日，根据中俄双方达成的共识，“海上联合-2015(Ⅱ)”军演在彼得大帝湾海域、克列尔卡角沿岸地区和日本海海空域举行。演习总导演分别由中国海军副司令员王海少将和俄罗斯海军副司令费多坚科夫中将担任。中方舰艇编队指挥员北海舰队副参谋长严正明海军大校。中方参演兵力由7艘水面舰艇、6架舰载直升机、5架固定翼飞机和200名陆战队员、21台两栖装备组成。7艘参演水面舰艇来自北海、东海、南海三大舰队，分别为115沈阳、138泰州、547临沂、568衡阳、989长白山、997云雾山、889太湖。据悉，上述舰艇均为三大舰队的现役主力战舰。9月初中俄联演结束后继续组织远海训练，5艘舰船在白令海航行并经塔纳加海峡进入西太平洋海域。于09.03到4日通过美国阿留申群岛间的国际海峡。这是中国人民解放军海军舰艇首次出现在该海域。','2016-10-18 20:44:57'),(120532313,1205323,2001,'护航编队#19，2014.12.02，中国海军第19批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2014.12.20护航开始，04.24护航结束，07.09归港。护航编队由550潍坊(2013.06.22)、547临沂(2012.11.22)、887微山湖(2004.04.18)组成。编队指挥员北海舰队副参谋长姜国平少将，编队政委北海舰队政治部副主任夏平少将；近700人；历时221天，完成36批109艘次中外船舶的护航任务，并首次直接靠泊交战区域港口实施撤离中外公民的国际救助活动，安全撤离16国897名中外公民，首次在地中海与俄罗斯海军进行联合军事演习；土耳其、克罗地亚、意大利','2016-10-18 20:44:57'),(120532314,1205323,1210,'134.1×16×4.5','2016-10-18 20:44:57'),(120532315,1205323,1211,'4053吨，标准3600吨','2016-10-18 20:44:57'),(120532316,1205323,1212,'27节','2016-10-18 20:44:57'),(120532317,1205323,1202,'2011.12.13','2016-10-18 20:44:57'),(120532318,1205323,1200,'临沂','2016-10-18 20:44:57'),(120532319,1205323,1206,'547','2016-10-18 20:44:57'),(120532320,1205323,1006,'1','2016-10-18 20:44:57'),(120532401,1205324,1201,'2013.06.22','2016-10-18 20:45:05'),(120532402,1205324,1203,'沪东造船厂','2016-10-18 20:45:05'),(120532403,1205324,1208,'护卫舰054A型','2016-10-18 20:45:05'),(120532404,1205324,1204,'驱1支队','2016-10-18 20:45:05'),(120532405,1205324,1205,'北海舰队','2016-10-18 20:45:05'),(120532406,1205324,2000,'中俄海上联合军事演习','2016-10-18 20:45:05'),(120532407,1205324,2000,'550潍坊','2016-10-18 20:45:05'),(120532408,1205324,2000,'也门撤侨','2016-10-18 20:45:05'),(120532409,1205324,2000,'索马里护航','2016-10-18 20:45:05'),(120532410