120888301,1208883,1201,'2013.06.18','2016-10-18 20:47:49'),(120888302,1208883,1203,'广船国际','2016-10-18 20:47:49'),(120888303,1208883,1208,'补给舰903型','2016-10-18 20:47:49'),(120888304,1208883,1204,'作战支援1支队','2016-10-18 20:47:49'),(120888305,1208883,1205,'北海舰队','2016-10-18 20:47:49'),(120888306,1208883,2000,'中俄海上联合军事演习','2016-10-18 20:47:49'),(120888307,1208883,2000,'889太湖','2016-10-18 20:47:49'),(120888308,1208883,2000,'海军机动六号军事演习','2016-10-18 20:47:49'),(120888309,1208883,2000,'环日航行','2016-10-18 20:47:49'),(120888310,1208883,2000,'索马里护航','2016-10-18 20:47:49'),(120888311,1208883,2001,'2014.12.04，5艘中国舰艇通过大隅海峡向东航行，随后在西太平洋参加机动六号军事演习：北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖。其中116石家庄于2014.12.15穿过宫古海峡进入东海。2014.12.25，4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，这支舰队接下来很可能穿过日本海，经朝鲜海峡返回位于山东的北海舰队基地，其航迹绕将日本一圈：112哈尔滨、538烟台、546盐城、889太湖。2014.12.28，对于正在绕行日本返回中国本土的中国海军舰艇编队，日本称已经表现出了高度的警戒。周六下午2点30分左右，日本海上自卫队第4护卫队群“凉月”号驱逐舰和第4航空群所属P-3C反潜机，在对马海峡东北约300公里的海域对中国海军舰艇编队进行了持续跟踪拍摄。','2016-10-18 20:47:49'),(120888312,1208883,2001,'2014.12，中国海军在西太平洋冲之鸟礁海域举行了代号“机动六号”的军事演习，是中国海军有史以来举行的最大规模的远海演习。这次演习出动北海舰队116石家庄、112哈尔滨、538烟台、546盐城、889太湖、东海舰队151郑州、138泰州、529舟山、548益阳、886千岛湖、851北极星、北海舰队170兰州、171海口、569玉林、573柳州等18艘水面舰船。2014.12.25，北海舰队4艘中国舰艇凌晨2点穿过宗谷海峡进入日本海，之后完成环日航行。','2016-10-18 20:47:49'),(120888313,1208883,2001,'2015.08.20-28日，根据中俄双方达成的共识，“海上联合-2015(Ⅱ)”军演在彼得大帝湾海域、克列尔卡角沿岸地区和日本海海空域举行。演习总导演分别由中国海军副司令员王海少将和俄罗斯海军副司令费多坚科夫中将担任。中方舰艇编队指挥员北海舰队副参谋长严正明海军大校。中方参演兵力由7艘水面舰艇、6架舰载直升机、5架固定翼飞机和200名陆战队员、21台两栖装备组成。7艘参演水面舰艇来自北海、东海、南海三大舰队，分别为115沈阳、138泰州、547临沂、568衡阳、989长白山、997云雾山、889太湖。据悉，上述舰艇均为三大舰队的现役主力战舰。9月初中俄联演结束后继续组织远海训练，5艘舰船在白令海航行并经塔纳加海峡进入西太平洋海域。于09.03到4日通过美国阿留申群岛间的国际海峡。这是中国人民解放军海军舰艇首次出现在该海域。','2016-10-18 20:47:49'),(120888314,1208883,2001,'护航编队#15，2013.08.08，中国海军第15批护航编队从南海舰队驻广东湛江某军港解缆起航，执行护航任务。2013.08.21护航开始，12.22护航结束，01.23归港。护航编队由999井冈山(2011.10.30)、572衡水(2012.07.09)、889太湖(2013.06.18)组成。编队指挥员南海舰队装备部部长姜中华少将(2014.09.02宁波跳楼自杀)，编队政委南海舰队某登陆舰支队政委肖民生大校；800余人；完成46批181艘中外船舶的护航任务，护送联合国粮食计划署船舶1艘；坦桑尼亚、肯尼亚、斯里兰卡','2016-10-18 20:47:49'),(120888315,1208883,2001,'护航编队#16，2013.11.30，中国海军第16批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2013.12.21护航开始，04.24护航结束，07.18归港。护航编队由546盐城(2012.06.05)、527洛阳(2005.09)、889太湖(2013.06.18)组成。编队指挥员北海舰队副参谋长李鹏程少将，编队政委北海舰队某驱逐舰支队政委孙健大校；660余人；共完成40批132艘中外船舶护航任务，先后派出特战队员53人次为18艘次船舶实施随船护卫，解救遭海盗袭扰商船1艘；突尼斯、科特迪瓦、喀麦隆','2016-10-18 20:47:49'),(120888316,1208883,2001,'护航编队#22，2015.12.06，中国海军第22批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2016.01.03护航开始，04.29护航结束，06.30归港。护航编队由113青岛(1996.05.28)、576大庆(2015.01.16)、889太湖(2013.06.18)组成。编队指挥员北海舰队装备部部长陈强南少将，编队政委海军某基地副政委黄新昌大校；700余人；执行护航122天，共承担25批、56艘中外船舶的护航任务，紧急救援中国渔船2批5名伤员，任务期间，编队常态性与外军护航兵力举行了联合演习；南非、坦桑尼亚、韩国','2016-10-18 20:47:49'),(120888317,1208883,1210,'178.5×24.8×8.7','2016-10-18 20:47:49'),(120888318,1208883,1211,'23000吨','2016-10-18 20:47:49'),(120888319,1208883,1212,'20节','2016-10-18 20:47:49'),(120888320,1208883,1202,'2012.03.22','2016-10-18 20:47:49'),(120888321,1208883,1200,'太湖','2016-10-18 20:47:49'),(120888322,1208883,1206,'889','2016-10-18 20:47:49'),(120888323,1208883,1006,'1','2016-10-18 20:47:49'),(120888401,1208884,1201,'2013.09.12','2016-10-18 20:47:54'),(120888402,1208884,1203,'沪东造船厂','2016-10-18 20:47:54'),(120888403,1208884,1208,'补给舰903型','2016-10-18 20:47:54'),(120888404,1208884,1204,'作战支援2支队','2016-10-18 20:47:54'),(120888405,1208884,1205,'东海舰队','2016-10-18 20:47:54'),(120888406,1208884,2000,'890巢湖','2016-10-18 20:47:54'),(120888407,1208884,2000,'索马里护航','2016-10-18 20:47:54'),(120888408,1208884,2001,'护航编队#17，2014.03.24，中国海军第17批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2014.04.18护航开始，08.28护航结束，10.22归港。护航编队由150长春(2013.01.31)、549常州(2011.05.30)、890巢湖(2013.09.12)组成。编队指挥员东海舰队副参谋长黄新建少将，编队政委东海舰队政治部副主任傅耀泉大校(2016年海军少将)；810余人；共完成43批115艘中外船舶护航任务，为17艘次船舶实施特殊护航，为1艘世界粮食计划署船舶护航，先后参与了援救韩海军舰艇失踪船员、营救意大利失火商船等行动；约旦、阿联酋、伊朗、巴基斯坦四国','2016-10-18 20:47:54'),(120888409,1208884,2001,'护航编队#18，2014.08.01，中国海军第18批护航编队从南海舰队驻广东湛江某军港解缆起航，执行护航任务。2014.08.19护航开始，12.26护航结束，03.19归港。护航编队由989长白山(2012.09.23)、571运城(2010.01.27)、890巢湖(2013.09.12)组成。编队指挥员南海舰队副参谋长张传书少将，编队政委海军某驱逐舰支队政委周名贵大校(2016年海军少将)；800多人；完成48批135艘次中外船舶的护航任务，先后为8艘次船舶实施特殊护航，首次为我国执行探月工程测量任务的远望3号提供护卫，并与美国、法国、希腊三国海军展开联合反海盗、国际人道主义救援演练；英国、德国、荷兰、法国、希腊五国','2016-10-18 20:47:54'),(120888410,1208884,2001,'护航编队#23，2016.04.07，中国海军第23批护航编队从东海舰队驻浙江舟山某军港解缆起航，执行护航任务。2016.04.29护航开始，09.02护航结束，11.01归港。护航编队由531湘潭(2016.02.24)、529舟山(2008.01.03)、890巢湖(2013.09.12)组成。编队指挥员东海舰队副参谋长王红理大校，编队政委东海舰队政治工作部副主任秦威大校；700余人；完成了39批79艘中外船舶护航任务，驱离疑似海盗船7批41艘，继续保持了被护船舶和自身的两个“百分之百”安全，护航期间湘潭舰代表中国海军远赴德国参加了于06.17-26举办的“基尔周”活动，这是中国海军首次派舰参加该活动；德国、缅甸、马来西亚、柬埔寨、越南','2016-10-18 20:47:54'),(120888411,1208884,1210,'178.5×24.8×8.7','2016-10-18 20:47:54'),(120888412,1208884,1211,'23000吨','2016-10-18 20:47:54'),(120888413,1208884,1212,'20节','2016-10-18 20:47:54'),(120888414,1208884,1202,'2012.05.07','2016-10-18 20:47:54'),(120888415,1208884,1200,'巢湖','2016-10-18 20:47:54'),(120888416,1208884,1206,'890','2016-10-18 20:47:54'),(120888417,1208884,1006,'1','2016-10-18 20:47:54'),(120888501,1208885,1201,'2015.12.28','2016-10-18 20:47:57'),(120888502,1208885,1203,'广船国际','2016-10-18 20:47:57'),(120888503,1208885,1208,'补给舰903型','2016-10-18 20:47:57'),(120888504,1208885,1204,'作战支援1支队','2016-10-18 20:47:57'),(120888505,1208885,1205,'北海舰队','2016-10-18 20:47:57'),(120888506,1208885,2000,'960东平湖','2016-10-18 20:47:57'),(120888507,1208885,2000,'索马里护航','2016-10-18 20:47:57'),(120888508,1208885,2001,'护航编队#24，2016.08.10，中国海军第24批护航编队从北海舰队驻山东青岛某军港解缆起航，执行护航任务。2016.09.02护航开始，护航结束，归港。护航编队由112哈尔滨(1994.05.08)、579邯郸(2015.08.16)、960东平湖(2015.12.28)组成。','2016-10-18 20:47:57'),(120888509,1208885,1210,'178.5×24.8×8.7','2016-10-18 20:47:57'),(120888510,1208885,1211,'23000吨','2016-10-18 20:47:57'),(120888511,1208885,1212,'20节','2016-10-18 20:47:57'),(120888512,1208885,1202,'2014.05.30','2016-10-18 20:47:57'),(120888513,1208885,1200,'东平湖','2016-10-18 20:47:57'),(120888514,1208885,1206,'960','2016-10-18 20:47:57'),(120888515,1208885,1006,'1','2016-10-18 20:47:57'),(120888601,1208886,1201,'2016.01.29','2016-10-18 20:48:04'),(120888602,1208886,1203,'广船国际','2016-10-18 20:48:04'),(120888603,1208886,1208,'补给舰903型','2016-10-18 20:48:04'),(120888604,1208886,1204,'作战支援2支队','2016-10-18 20:48:04'),(120888605,1208886,1205,'东海舰队','2016-10-18 20:48:04'),(120888606,1208886,2000,'966高邮湖','2016-10-18 20:48:04'),(120888607,1208886,2000,'环太平洋军事演习','2016-10-18 20:48:04'),(120888608,1208886,2000,'环日航行','2016-10-18 20:48:04'),(120888609,1208886,2001,'2016.06.16，5艘中国舰艇凌晨通过宫古海峡从东海向太平洋航行，参加“环太平洋—2016”演习：153西安、572衡水、966高邮湖、867长岛、和平方舟医院船。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海，途中密集进行了综合攻防操演、直升机起降、航行补给等多个科目的训练：153西安、572衡水、966高邮湖。2016.08.16，3艘中国舰艇傍晚在对马海峡西北约15公里处海域向东北偏北方向航行，进入日本海：532荆州、578扬州、886千岛湖。同日，俄罗斯海军导弹驱逐舰548“潘捷列耶夫海军上将号”穿过宗谷海峡后继续向东航行。2016.08.18，双方展开了实兵对抗演练，演练现场红蓝双方你攻我打，在遭受红方的海空协同突击后，担任蓝方的西安舰编队迅速展开反击，红方舰艇编队立即组织立体防御，现场充满了浓浓的火药味。08.18，中国海军航空兵运8警戒机一架，轰6轰炸机2架经由对马海峡飞入日本海上空。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行：153西安、572衡水、966高邮湖。','2016-10-18 20:48:04'),(120888610,1208886,2001,'2016.06.30-08.04，第25届环太平洋军事演习(RIMPAC)预计在夏威夷群岛和加利福尼亚州及其附近地区举行。包括美国和中国在内27个国家、45艘船舰、5艘潜水艇、200多架飞机和25000名人员将参加这一世界上规模最大的国际海上军演。中国海军参加“环太平洋—2016”演习兵力由153西安、572衡水、966高邮湖、867长岛、和平方舟医院船及3架舰载直升机、1个特战分队、1个潜水分队组成。根据中美两国达成的共识，中方此次将参加火炮射击、海上补给、损管救援、反海盗、舰机协同突击、搜索救援、潜水、援潜救生等科目演练。2016.08.14，3艘中国舰艇下午通过罗盘海峡、宗谷海峡进入日本海。2016.08.20，3艘中国舰艇下午5点左右南下对马海峡向西南航行，完成环日航行。','2016-10-18 20:48:04'),(120888611,1208886,1210,'178.5×24.8×8.7','2016-10-18 20:48:04'),(120888612,1208886,1211,'23000吨','2016-10-18 20:48:04'),(120888613,1208886,1212,'20节','2016-10-18 20:48:04'),(120888614,1208886,1202,'2014.12.20','2016-10-18 20:48:04'),(120888615,1208886,1200,'高邮湖','2016-10-18 20:48:04'),(120888616,1208886,1206,'966','2016-10-18 20:48:04'),(120888617,1208886,1006,'1','2016-10-18 20:48:04'),(120888701,1208887,1201,'2016.07.15','2016-10-18 20:48:09'),(120888702,1208887,1203,'广船国际','2016-10-18 20:48:09'),(120888703,1208887,1208,'补给舰903型','2016-10-18 20:48:09'),(120888704,1208887,1204,'作战支援3支队','2016-10-18 20:48:09'),(120888705,1208887,1205,'南海舰队','2016-10-18 20:48:09'),(120888706,1208887,2000,'963洪湖','2016-10-18 20:48:09'),(120888707,1208887,1210,'178.5×24.8×8.7','2016-10-18 20:48:09'