造船厂','2016-10-18 20:50:42'),(120915903,1209159,1208,'登陆舰072A型','2016-10-18 20:50:42'),(120915904,1209159,1204,'登陆舰6支队','2016-10-18 20:50:42'),(120915905,1209159,1205,'南海舰队','2016-10-18 20:50:42'),(120915906,1209159,2000,'中俄海上联合军事演习','2016-10-18 20:50:42'),(120915907,1209159,2000,'997云雾山','2016-10-18 20:50:42'),(120915908,1209159,2001,'2015.08.20-28日，根据中俄双方达成的共识，“海上联合-2015(Ⅱ)”军演在彼得大帝湾海域、克列尔卡角沿岸地区和日本海海空域举行。演习总导演分别由中国海军副司令员王海少将和俄罗斯海军副司令费多坚科夫中将担任。中方舰艇编队指挥员北海舰队副参谋长严正明海军大校。中方参演兵力由7艘水面舰艇、6架舰载直升机、5架固定翼飞机和200名陆战队员、21台两栖装备组成。7艘参演水面舰艇来自北海、东海、南海三大舰队，分别为115沈阳、138泰州、547临沂、568衡阳、989长白山、997云雾山、889太湖。据悉，上述舰艇均为三大舰队的现役主力战舰。9月初中俄联演结束后继续组织远海训练，5艘舰船在白令海航行并经塔纳加海峡进入西太平洋海域。于09.03到4日通过美国阿留申群岛间的国际海峡。这是中国人民解放军海军舰艇首次出现在该海域。','2016-10-18 20:50:42'),(120915909,1209159,2001,'2016.09.12-19日，根据中俄双方达成的共识，中俄两国海军将于9月在广东湛江以东海空域举行代号为“海上联合-2016”的联合军事演习。演习总导演分别由中国海军副司令员王海中将和俄罗斯海军副司令费多坚科夫中将担任。演习指挥员由南海舰队副司令员俞满江少将担任。中方的10艘演习舰艇以南海舰队兵力为主参加，包括168广州、151郑州、576大庆、574三亚、570黄山、998昆仑山、997云雾山、961军山湖、2艘新型常规潜艇。海军航空兵派出歼-11B战机、飞豹战机、预警机及多型舰载直升机等共计19架飞机参演。俄方的5艘演习舰艇2016.09.04已启程前往解放军海军湛江基地：564“无畏”级“特里布茨海军上将”号大型反潜舰、572“无畏”级“维诺格拉多夫海军上将”号大型反潜舰、077“蟾蜍”级“佩列斯韦特”号大型坦克登陆舰、“印古尔”级“阿拉套”号远洋拖船、“杜布纳”级“佩琴加”号中型远洋油船。','2016-10-18 20:50:42'),(120915910,1209159,1210,'119.5×16.4×3.2','2016-10-18 20:50:42'),(120915911,1209159,1211,'4800吨，标准3700吨','2016-10-18 20:50:42'),(120915912,1209159,1212,'18节','2016-10-18 20:50:42'),(120915913,1209159,1200,'云雾山','2016-10-18 20:50:42'),(120915914,1209159,1206,'997','2016-10-18 20:50:42'),(120915915,1209159,1006,'1','2016-10-18 20:50:42'),(120916001,1209160,1201,'2015.05.23','2016-10-18 20:50:46'),(120916002,1209160,1203,'武昌造船厂','2016-10-18 20:50:46'),(120916003,1209160,1208,'登陆舰072A型','2016-10-18 20:50:46'),(120916004,1209160,1204,'登陆舰5支队','2016-10-18 20:50:46'),(120916005,1209160,1205,'东海舰队','2016-10-18 20:50:46'),(120916006,1209160,2000,'981大别山','2016-10-18 20:50:46'),(120916007,1209160,1210,'119.5×16.4×3.2','2016-10-18 20:50:46'),(120916008,1209160,1211,'4800吨，标准3700吨','2016-10-18 20:50:46'),(120916009,120